import React from 'react';
import Navbar from './Components/Navbar';
import PropertyList from './Components/PropertyList'; // Corrected import name
import PropertySearch from './Components/Propertysearch'; // Corrected import name

const App = () => {
  return (
    <div className="flex flex-col items-center">
      <Navbar />
      <PropertySearch className="mb-0" /> {/* Set margin-bottom to zero */}
      <PropertyList className="mt-0" />
    </div>
  );
};

export default App;
